import React from "react";
import './GoalList.css'
const GoalList = () => {
    return (
        <ul className="goal-list">
            <li>Finish the course</li>
            <li>Learn all about main topic</li>
            <li>Help other students</li>
        </ul>
    )
}

export default GoalList
